import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { ScrollView } from "react-native-web";

export default function Home() {
  return (
    <ScrollView>
      <View styles={styles}>
        <Text>Home</Text>
      </View>
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
